style.css:
footer a[href*="impress.openneo.net/user/"] {
    position: fixed;
    top: 10px;
    right: 10px;
    padding: 10px;
    background: teal;
    color: #fff;
    font-weight: 700;
    font-size: 16px;
    border-radius: 4px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 4px 6px -1px, rgba(0, 0, 0, 0.06) 0px 2px 4px -1px !important;
}

footer a[href*="impress.openneo.net/user/"]:hover {
    text-decoration: none;
    transform: scale(1.1);
}
